import TC_Resume from './images/TC_Resume.pdf'
import { Navbar, Container, Nav } from "react-bootstrap";
import { useState, useEffect } from 'react';


function Navi() {
  const [activeLink, setActiveLink] = useState("home");
  const [scrolled, setScrolled] = useState(false);

  useEffect(() => {
    const onScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };
    window.addEventListener("scroll", onScroll);

    return () => window.removeEventListener("scroll", onScroll);
  }, []);

  const onUpdateActiveLink = (value) => setActiveLink(value);

  const handleEmail = () => {
    window.open("mailto:jason@jasonl.dev");
  };

  return (
    <Navbar expand="md" className={scrolled ? "scrolled" : ""}>
    <Container>
      <Navbar.Brand
        href="/"
        className={
          activeLink === "home" ? "active navbar-link" : "navbar-link"
        }
        onClick={() => onUpdateActiveLink("home")}
      >
        <h1>TRACEY CHUNG</h1>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav"></Navbar.Toggle>

      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link
            href="#about"
            className={
              activeLink === "home" ? "active navbar-link" : "navbar-link"
            }
            onClick={() => onUpdateActiveLink("home")}
          >
            About
          </Nav.Link>
          <Nav.Link
            href="#skills"
            className={
              activeLink === "skills" ? "active navbar-link" : "navbar-link"
            }
            onClick={() => onUpdateActiveLink("skills")}
          >
            Skills
          </Nav.Link>
          <Nav.Link
            href="#projects"
            className={
              activeLink === "projects" ? "active navbar-link" : "navbar-link"
            }
            onClick={() => onUpdateActiveLink("projects")}
          >
            PROJECTS
          </Nav.Link>
        </Nav>
        <span className="navbar-text">
          <div className="social-icon">
            <a
              href="https://www.linkedin.com/in/jasonlee220/"
              target="_blank"
              rel="noreferrer"
            >
              {/* <img src={navIcon1} alt="icon1" /> */}
            </a>
            <a
              href="https://github.com/jeelason"
              target="_blank"
              rel="noreferrer"
            >
              {/* <img src={navIcon2} alt="icon2" /> */}
            </a>
          </div>
          <button onClick={handleEmail}>
            <span>Let's Connect</span>
          </button>
        </span>
      </Navbar.Collapse>
    </Container>
  </Navbar>
    // <nav className='navBar'>
    //     <a href="#about"><h1>TRACEY CHUNG</h1></a>
    //     <ul>
    //         <a href="#about">About</a>
    //         <a href="#skills">Skills</a>
    //         <a href="#projects">Projects</a>
    //         <a href="#contact">Contact</a>
    //         <button>
    //           <a href={TC_Resume} download>Resume</a>
    //         </button>
    //     </ul>
    // </nav>
  )
}

export default Navi;
